ccsr_old_to_new_map_diagnosis.rename(columns={'CCSR Category':'New CCSR Diagnosis Code', 'CCS CATEGORY': 'Old CCSR Diagnosis Code', 'ICD-9-CM CODE DESCRIPTION': 'Mapping Diagnosis Description'}, inplace=True)

